import React, {Component} from 'react'
import Mobiles from './components/phones';
import './App.css'

class App extends Component {
  render(){
    return (
      <Mobiles mobiles={this.state.mobiles}/>
    )
  }
  state = {
    mobiles: []
  };
  componentDidMount(){
    const out = fetch('http://localhost:8080/phones')
    const data = out.json()
    this.setState({ mobiles: data})
    console.log(data)
  }
}

export default App;
